#include <iostream>
#include <string>
#include <ctime>
#include <unordered_map>
#include <algorithm>

using namespace std;

class Solution
{
public:
    int lengthOfLongestSubstring(string s)
    {
        size_t start = 0;
        size_t pos =0;

        size_t length = 0;
        string str;
        
        string substr;
        unordered_map<char,int> hmap;
        unordered_map<char,int>::const_iterator  it;


        while(pos != s.length())
        {
            it = hmap.find(s.at(pos));
            if (it == hmap.end())
            {
                int value = s.at(pos) - int(48);
                hmap.insert(pair<int,char>(s.at(pos),value));
                substr += s.at(pos);
                pos++;
            }
            else
            {
                start++;
                pos = start;
                if(length < substr.length())
                {
                    length = substr.length();
                    str = substr;
                    if (95 == length)
                    {
                        break;
                    }
                }
                hmap.clear();
                substr.clear();
            }
        }
        if(length < substr.length())
        {
            length = substr.length();
            str = substr;
        }
        std::cout << str << std::endl;
        return length;

    }
};



